import { Form, Input, Button, Checkbox } from "antd";
import React from "react";

const LoginForm = () => {
  return (
    <Form>
      <div>
        <label htmlFor="user-id">Id</label>
        <br />
        <Form.Item />
        <Input />
      </div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default LoginForm;
